import React, { useState } from 'react';
import axios from 'axios';

const AIFinancialAnalysis = ({ expenses, savings }) => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const [rawResponse, setRawResponse] = useState(null); // Para depuraci칩n

  const fetchAIAnalysis = async () => {
    if (expenses.length === 0 || savings.length === 0) {
      setError('No hay suficientes datos para realizar el an치lisis.');
      return;
    }

    setIsLoading(true);
    setError(null);
    setAiInsights(null);
    setRawResponse(null);

    try {
      const response = await axios.post('http://localhost:11434/api/generate', {
        model: "llama3.2:3b-instruct-q8_0",
        prompt: `Eres un analista financiero experto. Genera una respuesta **exclusivamente en JSON v치lido**, sin texto adicional ni comentarios.

        游늷 **Datos:**
        - Gastos: ${JSON.stringify(expenses)}
        - Ahorros: ${JSON.stringify(savings)}

        游늷 **Ejemplo de respuesta v치lida:**
        {
          "gastosTotales": 1000,
          "ahorrosTotales": 200,
          "analisisGastos": "Los gastos representan el 50% del ingreso.",
          "progresoAhorros": "Tienes ahorrado un 20% del objetivo.",
          "recomendaciones": ["Reducir gastos en entretenimiento", "Aumentar ingresos"],
          "categoriasMayorGasto": ["Vivienda", "Alimentaci칩n"],
          "potencialAhorro": 500
        }

        游늷 **Si no hay suficiente informaci칩n, responde con:**
        { "error": "No hay suficientes datos para analizar." }

        游뚿 **IMPORTANTE:** Responde solo con JSON puro, sin texto adicional ni markdown.`,
        stream: false,
      });

      if (!response.data || !response.data.response) {
        throw new Error('Respuesta inv치lida de la API.');
      }

      let aiText = response.data.response.trim();
      console.log("Respuesta cruda de la IA:", aiText);
      setRawResponse(aiText);

      // 游댳 Filtramos para extraer solo JSON v치lido
      const jsonMatch = aiText.match(/{.*}/s);
      if (!jsonMatch) {
        throw new Error("No se encontr칩 un JSON v치lido en la respuesta.");
      }

      const cleanJson = jsonMatch[0];

      // 游댳 Intentamos parsear el JSON
      try {
        const jsonData = JSON.parse(cleanJson);

        if (jsonData.error) {
          throw new Error(jsonData.error);
        }

        setAiInsights(jsonData);
      } catch (parseError) {
        console.error("Error al parsear JSON:", parseError);
        throw new Error("Formato JSON incorrecto.");
      }

    } catch (error) {
      console.error("Error al obtener an치lisis de la IA:", error);
      setError(error.message);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div>
      <h2>An치lisis Financiero con IA</h2>
      <button onClick={fetchAIAnalysis} disabled={isLoading}>
        {isLoading ? "Analizando..." : "Obtener An치lisis"}
      </button>

      {error && <p style={{ color: 'red' }}>Error: {error}</p>}

      {rawResponse && (
        <div>
          <h3>Respuesta sin procesar:</h3>
          <pre>{rawResponse}</pre>
        </div>
      )}

      {aiInsights && (
        <div>
          <h3>Resultados del An치lisis</h3>
          <p><strong>Gastos Totales:</strong> ${aiInsights.gastosTotales}</p>
          <p><strong>Ahorros Totales:</strong> ${aiInsights.ahorrosTotales}</p>
          <p><strong>An치lisis:</strong> {aiInsights.analisisGastos}</p>
          <p><strong>Progreso en Ahorros:</strong> {aiInsights.progresoAhorros}</p>

          <h4>Recomendaciones</h4>
          <ul>
            {aiInsights.recomendaciones.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>

          <h4>Categor칤as de Mayor Gasto</h4>
          <ul>
            {aiInsights.categoriasMayorGasto.map((item, index) => (
              <li key={index}>{item}</li>
            ))}
          </ul>

          <p><strong>Potencial de Ahorro:</strong> ${aiInsights.potencialAhorro}</p>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
